import React from 'react'
import hand_icon from '../Assets/hand_icon.png'

const Shop = () => {
  return (
    <div><h1>Womens New Arrival </h1>
    <p>New <img src={hand_icon} alt=""/>Collections for everywomen</p></div>
  )
}

export default Shop
